import { Route, Routes } from 'react-router-dom';
import Authentication from 'views/Authentication';
import Main from 'views/Main';
import './App.css';
import Search from 'views/Search';
import User from 'views/User';
import Detail from 'views/Board/Detail';
import Write from 'views/Board/Write';

//                component(app)                    //
function App() {
  //                render(app)             //
  //              description: 메인화면 : '/' - Main //
  //              description: 로그인 + 회원가입 : '/auth' - Authentication   //
  //              description: 검색화면: '/search/:word' - Search //
  //              description: 유저 페이지 : '/user/:userEmail' -User //
  //              description: 게시물 상세보기 : 'board/detail/:boardNumber' - Boarddetail //
  //              description: 게시물 작성하기 : 'board/write' - Boardwrite //
  //              description: 게시물 수정하기 : 'board/update/:boardNumber' - Boardupdate //

  return (
    <Routes>
      <Route path="/" element={<Main />} />
      <Route path="/auth" element={<Authentication />} />
      <Route path="/search" element={<Search />} />
      <Route path="/user" element={<User />} />
      <Route path='/board'>
      <Route path="detail/:boardNumber" element={<Detail />} />
      <Route path="write" element={<Write />} />
      <Route path="update" element={<Main />} />
      </Route>
    </Routes>
  );
}

export default App;
